import React, {useEffect, useState} from 'react';
import axios, {AxiosResponse} from "axios";
import {TextField} from "@mui/material";

function ComWithBackEx() {
    useEffect(() => {
        axios.get('https://localhost:7054/WeatherForecast')
            .then((response: AxiosResponse<any>)=>{
                console.log(response.data);
            })
    }, [])
    const [formData, setFormData] = useState({

    });

    const handleSubmit = async (e: React.FormEvent) => {
        e.preventDefault();

        try {
            const response = await axios.post('https://localhost:7054/api/User', {
                ...formData,
            }, {
                headers: {
                    'Content-Type': 'application/json',
                },
            });
            console.log('Response from server:', response.data);
            //navigate('/');
            window.location.reload()
        } catch (error) {
            console.error('Error submitting post:', error);
        }
    };
    return (
        <>
            <h1>
                Pavyzdys
            </h1>
            <p>Komunikacija su ASP.NET core</p>
            <div>
                <center><h1>New project</h1></center>
                <p>Title:   {' '} <TextField/></p>
                <p>About: {' '}
                    <TextField multiline = {true} /></p>
                <p>Languages: {' '}
                    <TextField/></p>
            </div>
        </>
    );

}

export default ComWithBackEx;
